import React, { Fragment } from "react";
import { Link } from "react-router-dom";
import "./my-list-item.css"


const MyListItem = ({ anime }) => {
    return (
        <Fragment>
            <td className="name">
                <Link to={`/animes/${anime.id}`}>{anime.name}</Link>
            </td>
            <td className="episodes">
                <input className="my-list-item-stats" type="text" onChange={() => console.log("рараррарарар")} value={anime.episodes} />
            </td>
            <td className="grade">
                <input className="my-list-item-stats" type="text" value={anime.grade} />
            </td>
        </Fragment>
    )
}

export default MyListItem;
